import React from "react";

const About = () => {
  return (
    <div className="about-page">
      <div className="text-container">
        <p>
          Hi! My name is Vivian and I'm a second year{" "}
          <u>Ph.D. student at the University of Colorado Boulder</u>. I'm
          advised by Aaron Clauset in the <u>Department of Computer Science</u>{" "}
          and Laura Dee in the{" "}
          <u>Department of Ecology and Evolutionary Biology</u>. I study
          ecological networks and species interactions.
        </p>
      </div>
    </div>
  );
};

export default About;
